import React from "react";
import node from "../images/node";

export default function Skills() {
  return (
    <div>
      <div
        className="skillsBox"
        style={{
          background: "#782aff",
          color: "yellow",
          height: "100vh",
          width: "100vw"
        }}
      >
        <div className="logo1box">
          <img src={node} className="rotateLogo1"></img>
        </div>
      </div>
      ;
    </div>
  );
}
